&quot;Working.&quot; The computer responded. &quot;Registry clean up in progress.&quot;

POLAR CLAW nodded and grunted, obviously not the most fluent when it
came to high tech computer systems. Give him a command team to run or
a compound to invade and he had it. But for this he left it up to
others.

A small blinking light made its way across the screen indicating its
progress. It actually moved quite fast, no doubt due to the fact that
the system was recently rebooted.

&quot;Registry Clean up complete.&quot; The computer said. &quot;System at nominal
and stable levels.&quot; It came back. &quot;Tracing transmission location.&quot; It
said and then quickly came back, &quot;transmission location initiated at
this console.&quot;

From the read out on the computer display it showed several
transmission attempts within the past week, all originating from the
very console that NIGHTSHIFT was sitting.

PROWL shook his head, &quot;Who ever was here, they didn&#39;t really have any
kind of hacking skills.&quot;

&quot;Yeah, look at the ID codes.&quot; WOLFGANG said as he pointed at the
screen. &quot;They were all the same, just an entry technician code. No
wonder the satellite demanded a password.&quot;

There was a slight shrug from PROWL, &quot;I doubt though it was a
technician who did this, they would have the knowledge to get around
the system better than that.&quot;

Now it was WOLFGANG who grunted, &quot;It could have been those insect things.&quot;

POLAR CLAW leaned in his interest finally piqued at WOLFGANG&#39;s comment.

